  description: |-
    Special thanks to **BSC** **/ VIP Members.**

    The v2 update contains the compiled props and updated/cleaned up lot files too. They are also BTE enabled.

    **Tractor props**:

    Grfe_fertilizer_spreaders (seasonal props)

    Grfe_field_irrigation_32m

    Grfe_field_irrigation_48m

    Grfe_harvester_A

    Grfe_harvester_B (seasonal props)

    Grfe_harvester_C

    Grfe_harvester_D (seasonal props)

    Grfe_harvester_E

    Grfe_harvester_F (seasonal props)

    Grfe_harvester_G (seasonal props)

    Grfe_plow (seasonal props)

    Grfe_roll_belt_A (seasonal props)

    Grfe_roll_belt_B

    Grfe_seed_drill (seasonal props)

    Grfe_self_propelled_sprayer_A

    Grfe_self_propelled_sprayer_B (seasonal props)

    Grfe_sprayer

    Grfe_sprayer_B

    Grfe_stubble_cultivator (seasonal props)

    Grfe_tractor_A (seasonal props)

    Grfe_tractor_C (seasonal props)

    Grfe_tractor_D (seasonal props)

    Grfe_trailer_A

    Grfe_trailer_B

    Grfe_trailer_C

    Grfe_trailer_harvester_A

    **LOT**:

    Corn, rapeseed and wheat are available as ploppable LOT (1 LOT with tractors and 1 LOT without tractors) that you can find under park menu.

    This pack also includes growable farms and farm fields.

    Note: the farms do not include any visible building (farm house) only plain field.
